import React, { Component } from 'react'

class RefundPage extends Component {
    render() {
        return (
            <Fragment>
            <TopNavigation title="Refund Policy" />  
            <PageTop pagetitle="Refund Policy" /> 
             <RefundDescription />
             <Footer />
         </Fragment>
        )
    }
}

export default RefundPage
